        // user.rateApp(app_address, new_rating);
        // (uint rating_int, uint rating_modulu, uint num_ratings) = curr_app.rateApp(new_rating, old_rating);
        // emit Events.AppRated(_app_id, rating_int, rating_modulu, num_ratings);
